import React from "react";

const About = () => (
  <section className="about">
    <h2>About Me</h2>
    <p>
      Hi! I'm Henry Geng, a graduate student at Northeastern University's Khoury College.
      I have a background in physics, QA automation, and software engineering.
      I enjoy cooking, anime, and video games.
    </p>
  </section>
);

export default About;
